“Florida Wildlife Corridor” is my latest outdoor sculpture commissioned by Art in Public Places Miami Beach for Aspen Ideas: Climate. The mirrored stainless steel sculpture incorporates the surrounding landscape through itself and its reflection of it. Currently on view @miamibeachgarden Look closely, you might miss it. 🌀🦅 

Special thanks to @studiojamesbrazil for helping me realize this project. 

